import React from 'react';
import californiaImage from './images/California.jpg';
import './App.css';
import './css/banner.css';





function App() {
  return (
    <div className="App">
      <header className="bannerImage">
        <h1 className="bannerName">Yuxuan Yao</h1>
      </header>
    </div>
  );
}




export default App;
